import React, { Component } from "react";
import "./App.css";

class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: [
        {
          id: 1,
          name: 'Mula Sem Cabeça'
        },
        {
          id: 2,
          name: 'Pé Grande'
        },
        {
          id: 3,
          name: 'Abominável Homem das Neves'
        },
        {
          id: 4,
          name: 'Zumbi'
        }
      ]
    }
  }

  render() {
    return (
      <div className="App">
       {
         this.state.monsters.map(m => (
           <h1 key={m.id}>{m.name}</h1>
           ))
       }
      </div>
    );
  }
}

export default App;
